import React from 'react';
import './header.css';
import logo from '../assets/logo_header.png';
export default Header;

function Header() {
    return (
        <header>
            <div className='header'>
                <img src={logo} alt="Sacadon Logo" className='logo_header' />
                <nav>
                    <ul>
                        <li><a href="/">Notre mission</a></li>
                        <li><a href="/about">Nos sacs</a></li>
                        <li><a href="/services">Impacts</a></li>
                        <li><a href="/contact">Contact</a></li>
                        <li><a href="/contact">Nous rejoindre</a></li>
                    </ul>
                </nav>
                <img src={logo} alt="Sacadon Logo" className='shopping' />
            </div>
        </header>
    );
}
